import React, { useState } from 'react';

export default function Login() {
  const [user,setUser] = useState({
    email:'',password:''
  })



  const onChangeInput = (e) =>{
      const {name , value} = e.target
      setUser({...user ,[name]:value})
  }
  return <div className='login-page'>
         <form>
         <input type='email' placeholder='Email' name='email' required value={user.email} onChange={onChangeInput} />
         <input type='password' placeholder='Password' name='password' required autoComplete='on' value={user.email} onChange={onChangeInput} />

          </form>     
  </div>;
}
